  (55, 4, 9, 'When it swims at\nfull speed using\nits long, webbedlimbs, its fore­\nhead somehow be­\ngins to glow.'),
  (55, 5, 9, 'It appears by\nwaterways at dusk.\nIt may use tele­kinetic powers if\nits forehead glows\nmysteriously.'),
  (55, 6, 9, 'It swims grace­\nfully along on the\nquiet, slow-movingrivers and lakes\nof which it is so\nfond.'),
