  (119, 5, 9, 'Using its horn, it\nbores holes in\nriverbed boulders,making nests to\nprevent its eggs\nfrom washing away.'),
  (119, 6, 9, 'When autumn comes,\nthe males patrol\nthe area aroundtheir nests in\norder to protect\ntheir offspring.'),
