  (368, 7, 9, 'GOREBYSS lives in the southern seas\nat extreme depths. Its body is built to\nwithstand the enormous pressure ofwater at incredible depths. Because of\nthis, this POKéMON’s body is unharmed\nby ordinary attacks.'),
