  (627, 23, 5, 'Il casse les Baies avec ses serres. Il combat\ncourageusement, quelle que soit la force de\nl’adversaire.'),
  (627, 23, 6, 'Kann mit seinen Füßen Nüsse zermalmen.\nEs stellt sich jedem noch so starken Gegner\ntapfer zum Kampf.'),
