  (633, 24, 5, 'Comme il ne voit rien, il perçoit son environnement\nen mordant et en fonçant à tout va.'),
  (633, 24, 6, 'Da es nichts sehen kann, rammt und frisst es alles,\nwas ihm auf dem Weg in die Quere kommt.'),
  (633, 24, 7, 'No ve bien a su alrededor, por eso va chocándose a\ndiestro y siniestro, y mordiendo todo lo que se mueve.'),
  (633, 24, 8, 'Non vede bene ciò che lo circonda e sbatte qua e\nlà mordendo e mangiando tutto ciò che si muove.'),
