  (676, 24, 5, 'Il y a fort longtemps dans la région de Kalos,\nce Pokémon fut le gardien des rois et des reines.'),
  (676, 24, 6, 'Vor langer Zeit wurde dieses Pokémon in der\nKalos-Region als Leibgarde des Königs eingesetzt.'),
  (676, 24, 7, 'Antiguamente, estos Pokémon desempeñaban el\ncometido de guardián del rey en la región de Kalos.'),
  (676, 24, 8, 'Nell’antica Kalos, questo Pokémon aveva il compito\ndi proteggere i re.'),
  (676, 24, 9, 'Historically, in the Kalos region, these Pokémon\nwere the designated guardians of the king.'),
